import React, { Component } from "react";

import ItemProduct from '../medium/product';
import NavigationBar from '../medium/navbar';


class Product extends Component {
  render() {
     return (
     <div>
       <NavigationBar/>
       <ItemProduct/>
     </div>
     );
  }
}

export default Product;
